import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Edit <code>src/App.js</code> and save to reload.
        </p>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

function NavBar(){
  return(
    <nav>
      <ul>
        <li>Home</li>
        <li>Gallery</li>
        <li>Store</li>
        <li>Contact</li>
        <li>Location</li>
      </ul>
    </nav>
  )
}

function Article1(){
  return(
    <article>
      <div>
        <span>Home</span>
        <span>article 1</span>
        <span>fuck off</span>
        <span>son of a bitch</span>
        <span>ok bye</span>
      </div>
    </article>
  )
}
export default {App , NavBar , Article1};
